import React from 'react'
import { Link } from 'react-router-dom'

const Navbar = () => {
  return (
    <div>
      <h2>DH Odonto </h2>
      <Link to='/'><h4>Home</h4></Link>
      <Link to='/favs'><h4>Favs</h4></Link>
      <Link to='/contact'><h4>Contact</h4></Link>
    </div>
  )
}

export default Navbar
